'use strict';const {PrismaClient}=require("./app/generated/prisma"),prisma=new PrismaClient;async function listUsers(){try{console.log("Listing all users...");const a=await prisma.user.findMany({select:{id:!0,email:!0,name:!0,emailVerified:!0,createdAt:!0}});console.log("Users found:",a.length);a.forEach(b=>{console.log(`- ID: ${b.id}, Email: ${b.email}, Name: ${b.name}, Verified: ${b.emailVerified}`)})}catch(a){console.error("Error listing users:",a)}finally{await prisma.$disconnect()}}listUsers();